import { Routes, Route } from 'react-router-dom';

import About from './About/About.js';
import Nav from './Nav';
import Home from './Home/Home.js';

function Layout() {
  return (
    <>
      <div className='
      max-[480px]:flex-col
      flex 
      flex-row
      '>
        <Nav />
        <Routes>
          <Route path='/' element={<Home />}/>
          <Route path='/about' element={<About />}/>
        </Routes>
      </div>
    </>
  )
}

export default Layout;
